import { Link, useParams } from 'react-router-dom';
import './card.css'
function Card({img ,id}) {
    return(
        <Link to={"/"}>
            <div className="card">
            <img src={img} alt="img"></img>
        </div>
        </Link>
    );
}
export default Card;
